import React from "react";
import PropTypes from "prop-types";
import Moment from "react-moment";

const Experience = props => {
  return (
    <div>
      <h2 className="text-primary">Experience</h2>
      <h3 class="text-dark">{props.experience.company}</h3>
      <p>
        <Moment format="YYY/MM/DD">{props.experience.from}</Moment> -{" "}
        {props.experience.to ? (
          <Moment format="YYY/MM/DD">{props.experience.ti}</Moment>
        ) : (
          " Now"
        )}
      </p>
      <p>
        <strong>Position: </strong>Senior Developer
      </p>
      <p>
        <strong>Description: </strong>Lorem ipsum dolor sit amet consectetur
        adipisicing elit. Dignissimos placeat, dolorum ullam ipsam, sapiente
        suscipit dicta eius velit amet aspernatur asperiores modi quidem
        expedita fugit.
      </p>
    </div>
  );
};

Experience.propTypes = {
  experience: PropTypes.object.isRequired
};

export default Experience;
